import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWhatsapp, faGithub } from '@fortawesome/free-brands-svg-icons';
import '../Css/header.css';


const Header = () => {

    const handleDownload = () => {
        const link = document.createElement('a');
        link.href = '/Assets/CV_MUHAMMAD_ALVIN_NEW.pdf'; // Ganti dengan path ke file PDF yang ingin didownload
        link.setAttribute('download', 'CV_MUHAMMAD_ALVIN.pdf'); // Nama file yang akan di-download
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    };

  return (
    <div className="header">
        <Container>
        <Row lg={2}>
            <Col>
                <p className='fwb'>Halo, Perkenalkan Saya,</p>
                <h1 className='fwb text-yellow'>MUHAMMAD ALVIN</h1>
                <p className='fwb'>Junior Frontend Developer</p>
                <button onClick={handleDownload} className='button-cv bg-yellow text-purple fwb'>
                    <p className='fwb pop'>Download CV</p>
                </button>
                <div className='info'>
                    <div className='icon'>
                        <FontAwesomeIcon icon={faWhatsapp} />
                    </div>
                    <div className='icon'>
                        <FontAwesomeIcon icon={faGithub} />
                    </div>
                    <div className='icon'>
                        <FontAwesomeIcon icon={faEnvelope} />
                    </div>
                    <div className='icon'>
                        <FontAwesomeIcon icon={faWhatsapp} />
                    </div>
                </div>
            </Col>
        </Row>
        </Container>
    </div>
  );
}

export default Header;
